import React from "react";
import "./Button.css";
import { Link } from "react-router-dom";

const STYLES = ['btn--primary', 'btn--outline']

const SIZES = ['btn--medium', 'btn--large'];

export const Button = ({ 
    children, 
    type, 
    onClick, 
    buttonStyle,
    buttonSize,
 }) => {
    const checkButtontStyle = STYLES.includes(buttonStyle) 
    ? buttonStyle 
    : STYLES[0];

    const checkButtontSize = SIZES.includes(buttonSize) 
    ? buttonSize
    : SIZES[0];

    return (
        <Link to='/signup' className='btn-mobile'>
            <button
            className={`btn far fa-user ${checkButtontStyle} ${checkButtontSize}`}
            onClick={onClick}
            type={type}
            >
                {children}
            </button>

            <button
            className={`btn <i class="fa-solid fa-right-from-bracket"></i> ${checkButtontStyle} ${checkButtontSize}`}
            onClick={onClick}
            type={type}
            >
                {children}
            </button>
            </Link>

    );
 };
